import React from 'react'
import { Route, NavLink, Switch, Redirect } from "react-router-dom";
import classNames from 'classnames/bind'
import styles from '../CSS/main.module.css'
let cx = classNames.bind(styles);

const Home = () => {
    return (
        <div className={cx('home')}>
            <p className={cx('title-info-mobile')}>
                <p className={cx('title-info-mobile-one')}>Tham gia máy chủ ngay hôm nay</p>
                <p className={cx('title-info-mobile-two')}>Nhiều sự kiện hấp dẫn đang chờ bạn</p>
            </p>
            <div className={cx('button-mobile')}>

            </div>
        </div>
    )
}
export default Home;
